//import { ReactNode } from 'react'
import { Event } from '../models/event';

interface Props {
  events: Array<Event>;
  id: number;
  description: string;
  date: string;
  onDelete:(id: number) => void;
}


const Item: React.FC<Props> = ({id,description,date,onDelete}) => {
    return (
    <li>
        <b>{description}</b>
        <p>{date}</p>
        <small>{id}</small>
        <button onClick={() => onDelete(id)}>Remove</button>
    </li>
  )
}

export default Item
